function compare(result, expect) {
    if (expect instanceof Array) {
        let rb = result.b;
        let eb = expect.b;
        if (result.length != expect.length) {
            console.log('\nFAIL: array lengths differ');
            showCode();
            console.log('');
            if (result.length > 40) {
                console.log('> [' + rb.slice(result.o, result.o + 40) + ', ...]');
            } else {
                console.log('> [' + rb.slice(result.o, result.o + result.length) + ']');
            }
            if (expect.length > 40) {
                console.log('> [' + eb.slice(0, 40) + ', ...]');
            } else {
                console.log('> [' + eb + ']');
            }
            return false;
        } else {
            // The expect array is always offset-0.
            // The result array can be a live view.
            for (let e = 0, r = result.o, l = expect.length; e < l; e++) {
                if (rb[r + e] != eb[e]) {
                    console.log('\nFAIL: arrays differ');
                    showCode();
                    console.log('');
                    if (l > 40) {
                        console.log('> [' + rb.slice(result.o, result.o + 40) + ', ...]');
                        console.log('> [' + eb.slice(0, 40) + ', ...]');
                    } else {
                        console.log('> [' + rb.slice(result.o, result.o + l) + ']');
                        console.log('> [' + eb + ']');
                    }
                    return false;
                }
            }
        }
    } else {
        if (result instanceof Uint8Array) {
            result = String.fromCharCode.apply(String, result);
        }
        if (result !== expect) {
            console.log('\nFAIL: ' + JSON.stringify(result) + ' != ' + JSON.stringify(expect));
            showCode();
            return false;
        }
    }
    //console.log('PASS');
    return true;
}

function showCode() {
    try {
        let stack = '' + (new Error('showcode')).stack;
        let m = /bwipp_runtest_(\w+) .*\.js:(\d+)/.exec(stack);
        if (m) {
            let sym = m[1];
            let lnbr = +m[2]
            let line = pstestLines[lnbr - 1];

            // Look for the #lnbr comment
            let l = /\/\/\s*#(\d+)/.exec(line);
            if (l) {
                let lnbr = l[1] - 1;
                let lines = fs.readFileSync('ps_tests/' + sym + '.ps', 'binary').split(/\r?\n/g);
                // work backwards until we see a blank line
                let first = lnbr;
                while (first > lnbr - 5) {
                    if (!lines[first].trim()) {
                        first++;
                        break;
                    }
                    first--;
                }
                console.log('FAILED AT: ps_tests/' + sym + '.ps:' + (lnbr + 1));
                for (let i = first; i < lnbr; i++) {
                    console.log('  ' + lines[i]);
                }
                console.log('> ' + lines[lnbr]);
                lines[lnbr + 1].trim() && console.log('  ' + lines[lnbr + 1]);
            }
        }
    } catch (e) {
        console.log(e);
    }
}

